import React from 'react'
import { Link } from 'react-router-dom'
import { Toolbar, Button, IconButton, Divider, Drawer, Hidden, List, ListItem, CssBaseline, } from '@material-ui/core'
import { makeStyles,useTheme } from '@material-ui/core/styles'
import MenuIcon from '@material-ui/icons/Menu'
import logo from '../../assets/images/integrifyLogo.png'
import SignUp from '../Auth/SignUp'
import LogIn from '../Auth/LogIn'


const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        justifyContent: 'space-between'
    },
    logo: {
        margin: 10,
        width: 100,
        height: 47
    },
    controllers: {
        display: 'inline-flex',
        justifyContent: 'space-between',
        width: '180px'
    },
    drawer: {
        display:'none',
        [theme.breakpoints.up('sm')]: {
            width: drawerWidth,
            flexShrink: 0,
        },
    },
    toolbar: theme.mixins.toolbar,
    drawerPaper: {
        width: drawerWidth,
    },
    menuButton: {
        color:'white',
        marginRight: theme.spacing(2),
        [theme.breakpoints.up('sm')]: {
            display: 'none',
        },
    },
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },

}))

const drawerWidth = 180;

const SignedOutLinks = (props) => {
    const { container } = props;
    const classes = useStyles();
    const theme = useTheme();
    const [mobileOpen, setMobileOpen] = React.useState(false);

    function handleDrawerToggle() {
        setMobileOpen(!mobileOpen);
    }

    const drawer = (
        <div style={{backgroundColor:'none'}}>
            <div className={classes.toolbar} />
            <Divider />
            <List>
                <ListItem>
                    <Button variant="contained" color="secondary" component={SignUp} to="/signin">sign up</Button>
                </ListItem>
                <ListItem>
                    <Button size="small" variant="contained" color="primary" component={LogIn} to="/signup">log in</Button>
                </ListItem>
            </List>
        </div>
    );

    return (
        <Toolbar className={classes.root}>
        <CssBaseline />
            <div className={classes.controllers}>
                <IconButton color="inherit" edge="start" onClick={handleDrawerToggle} className={classes.menuButton}>
                    <MenuIcon />
                </IconButton>
                <div>
                    <Link to="/">
                        <img alt="logo" src={logo} className={classes.logo} />
                    </Link>
                </div>

            </div>
            <nav className={classes.drawer}>
                <Hidden smUp implementation="css">
                    <Drawer
                        container={container}
                        variant="temporary"
                        anchor={theme.direction === 'rtl' ? 'right' : 'left'}
                        open={mobileOpen}
                        onClose={handleDrawerToggle}
                        classes={{
                            paper: classes.drawerPaper,
                        }}
                        ModalProps={{
                            keepMounted: true, // Better open performance on mobile.
                        }}
                    >
                        {drawer}
                    </Drawer>
                </Hidden>
                <Button variant="contained" color="secondary" component={SignUp} to="/signin">
                    sign up
                </Button>
                <Button variant="contained" color="primary" component={LogIn} to="/signup">
                    log in
                </Button>
                <Hidden xsDown implementation="css">
                    <Drawer
                        classes={{
                            paper: classes.drawerPaper,
                        }}
                        variant="permanent"
                        open
                    >
                        {drawer}
                    </Drawer>
                </Hidden>
            </nav>
        </Toolbar>
    )
}

export default SignedOutLinks
